import React, { Component } from "react";
import { StyleSheet, Button, View, Text, TouchableOpacity } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";

export default class QuestScreen extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <View style={{ flex: 1, flexDirection: "row" }}>
        <View
          style={{
            width: 100,
            height: 50,
            alignItems: "left",
            justifyContent: "center",
          }}
        >
          <Button
            title="Home"
            onPress={() => this.props.navigation.navigate("Home")}
          />
        </View>
        <View
          style={{
            width: 1000,
            height: 50,
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <Text>Quest Page</Text>
        </View>
        <TouchableOpacity style={styles.GooglePlusStyle} activeOpacity={0.5}>
          <Image
            styles={styles.ImageStyle}
            source={require("../app/assets/home.png")}
          />
          <View style={styles.SeparatorLine} />
          <Text style={styles.TextStyle}>Reward Points</Text>
        </TouchableOpacity>
        {/* <Button
          title="Go back"
          onPress={() => this.props.navigation.goBack()}
        /> */}
      </View>
    );
  }
}

const styles = StyleSheet.create({
  MainContainer: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    margin: 10,
  },
  GooglePlusStyle: {
    flexDirection: "row",
    alignItems: "center",
    backgroundColor: "#dc4e41",
    borderWidth: 0.5,
    borderColor: "#fff",
    height: 40,
    width: 220,
    borderRadius: 5,
    margin: 5,
  },
  FacebookStyle: {
    flexDirection: "row",
    alignItems: "center",
    backgroundColor: "#485a96",
    borderWidth: 0.5,
    borderColor: "#fff",
    height: 40,
    width: 220,
    borderRadius: 5,
    margin: 5,
  },
  TextStyle: {
    color: "#fff",
    marginBottom: 4,
    marginRight: 20,
  },
  ImageStyle: {
    color: "#fff",
    marginBottom: 4,
    marginRight: 20,
  },
  SeparatorLine: {
    backgroundColor: "#fff",
    width: 1,
    height: 40,
  },
});
